import React from 'react';
import './App.css';

function App() {
  return (
    <div className="Page">
      <div className="Banner">
        <div className="Header">
          <h1>Blake Madigan</h1>
        </div>
      </div>
      <div className="Content">
        <h2>Portfolio</h2>
      </div>
    </div>
  );
}

export default App;
